import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import ProductsPage from "./pages/ProductsPage";

const App = () => {
  return (
    <>
      {/* Nav bar */}
      <Router>
        <Switch>
          <Route exact path="/" component={ProductsPage} />
        </Switch>
      </Router>
    </>
  );
};

export default App;
